import {Link} from "react-router-dom";
import "./home.css"


const Home = () => {
  return (
    <div className="container-fluid home-cointainer text-center">
      <h1>Home</h1>
      <div></div>
      <Link className="btn btn-secondary"to="/signup">Sign Up</Link>
      <Link className="btn btn-secondary"to="/login">Log in</Link>
    </div>
  )
}

export default Home;
